import React, { useEffect, useState } from "react";

function Relogio() {
    const [relogio, setRelogio] = useState();

    useEffect(() => {
        setInterval(() => {
            const data = new Date();
            setRelogio(data.toLocaleTimeString());
        }, 1000);
    }, []);

    return <div className="relogio center">{relogio}</div>;
}
export default Relogio;
